#
# TABLE STRUCTURE FOR: book
#
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS `staffContact`;
DROP TABLE IF EXISTS `staff`;
DROP TABLE IF EXISTS `bookBorrowings`;
DROP TABLE IF EXISTS `bookGenre`;
DROP TABLE IF EXISTS `bookAuthor`;
DROP TABLE IF EXISTS `reviews`;
DROP TABLE IF EXISTS `borrowings`;
DROP TABLE IF EXISTS `bBorrowings`;
DROP TABLE IF EXISTS `fines`;
DROP TABLE IF EXISTS `borrowerContact`;
DROP TABLE IF EXISTS `borrower`;
DROP TABLE IF EXISTS `historyLog`;
DROP TABLE IF EXISTS `genre`;
DROP TABLE IF EXISTS `book`;


CREATE TABLE `book` (
  `ISBN` CHAR(13) NOT NULL,
  `title` VARCHAR(255) NOT NULL,
  `publishedDate` DATE NOT NULL,
  PRIMARY KEY (`ISBN`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: bookAuthor
#

DROP TABLE IF EXISTS `bookAuthor`;

CREATE TABLE `bookAuthor` (
  `ISBN` CHAR(13) NOT NULL,
  `author` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`ISBN`, `author`),
  FOREIGN KEY (`ISBN`) REFERENCES `book` (`ISBN`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: bookBorrowings
#

DROP TABLE IF EXISTS `bookBorrowings`;

CREATE TABLE `bookBorrowings` (
  `ISBN` char(13) NOT NULL,
  `borrowingID` int(11) NOT NULL,
  PRIMARY KEY (`ISBN`),
  UNIQUE KEY `ISBN` (`ISBN`),
  UNIQUE KEY `borrowingID` (`borrowingID`),
  CONSTRAINT `bookBorrowings_ibfk_1` FOREIGN KEY (`ISBN`) REFERENCES `book` (`ISBN`),
  CONSTRAINT `bookBorrowings_ibfk_2` FOREIGN KEY (`borrowingID`) REFERENCES `borrowings` (`borrowingID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: bookGenre
#

DROP TABLE IF EXISTS `bookGenre`;

CREATE TABLE `bookGenre` (
  `ISBN` CHAR(13) NOT NULL,
  `genreType` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`ISBN`),
  FOREIGN KEY (`ISBN`) REFERENCES `book` (`ISBN`),
  FOREIGN KEY (`genreType`) REFERENCES `genre` (`genreType`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: borrower
#

DROP TABLE IF EXISTS `borrower`;

CREATE TABLE `borrower` (
  `borrowerID` INT(11) NOT NULL AUTO_INCREMENT,
  `membershipDate` DATE NOT NULL,
  `bPassword` VARCHAR(255) NOT NULL,
  `bEmail` VARCHAR(255) NOT NULL UNIQUE,
  PRIMARY KEY (`borrowerID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: borrowerContact
#

DROP TABLE IF EXISTS `borrowerContact`;

CREATE TABLE `borrowerContact` (
  `bEmail` VARCHAR(255) NOT NULL,
  `bName` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`bEmail`),
  FOREIGN KEY (`bEmail`) REFERENCES `borrower` (`bEmail`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: bBorrowings
#

DROP TABLE IF EXISTS `bBorrowings`;

CREATE TABLE `bBorrowings` (
  `borrowerID` int(11) NOT NULL,
  `borrowingID` int(11) NOT NULL,
  PRIMARY KEY (`borrowerID`),
  KEY `borrowingID` (`borrowingID`),
  CONSTRAINT `bBorrowings_ibfk_1` FOREIGN KEY (`borrowerID`) REFERENCES `borrower` (`borrowerID`),
  CONSTRAINT `bBorrowings_ibfk_2` FOREIGN KEY (`borrowingID`) REFERENCES `borrowing` (`borrowingID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: borrowings
#

DROP TABLE IF EXISTS `borrowings`;

CREATE TABLE `borrowings` (
  `borrowingID` INT(11) NOT NULL AUTO_INCREMENT,
  `borrowDate` DATE NOT NULL,
  `returnDate` DATE,
  `status` ENUM('On Hold', 'Returned', 'Late') NOT NULL,
  `borrowerID` INT(11) NOT NULL,
  `ISBN` CHAR(13) NOT NULL,
  `fineID` INT(11) DEFAULT NULL,
  PRIMARY KEY (`borrowingID`),
  FOREIGN KEY (`borrowerID`) REFERENCES `borrower` (`borrowerID`),
  FOREIGN KEY (`ISBN`) REFERENCES `book` (`ISBN`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: fines
#

DROP TABLE IF EXISTS `fines`;

CREATE TABLE `fines` (
  `fineID` INT(11) NOT NULL AUTO_INCREMENT,
  `borrowerID` INT(11) NOT NULL,
  `dueDate` DATE NOT NULL,
  `datePaid` DATE DEFAULT NULL,
  PRIMARY KEY (`fineID`),
  FOREIGN KEY (`borrowerID`) REFERENCES `borrower` (`borrowerID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: genre
#

DROP TABLE IF EXISTS `genre`;

CREATE TABLE `genre` (
  `genreType` VARCHAR(255) NOT NULL,
  `genreDescription` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`genreType`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: historyLog
#

DROP TABLE IF EXISTS `historyLog`;

CREATE TABLE `historyLog` (
  `logID` int(11) NOT NULL AUTO_INCREMENT,
  `generatedDate` date NOT NULL,
  `staffID` int(11) NOT NULL,
  `text` text DEFAULT NULL,
  `type` enum('Borrowing','Return','Damage') NOT NULL,
  PRIMARY KEY (`logID`),
  KEY `staffID` (`staffID`),
  CONSTRAINT `historyLog_ibfk_1` FOREIGN KEY (`staffID`) REFERENCES `staff` (`staffID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: reviews
#

DROP TABLE IF EXISTS `reviews`;

CREATE TABLE `reviews` (
  `reviewID` int(11) NOT NULL AUTO_INCREMENT,
  `reviewDate` date NOT NULL,
  `borrowerID` int(11) NOT NULL,
  `reviewText` text DEFAULT NULL,
  `rating` int(11) NOT NULL,
  `ISBN` char(13) NOT NULL,
  PRIMARY KEY (`reviewID`),
  KEY `borrowerID` (`borrowerID`),
  KEY `ISBN` (`ISBN`),
  CONSTRAINT `reviews_ibfk_1` FOREIGN KEY (`borrowerID`) REFERENCES `borrower` (`borrowerID`),
  CONSTRAINT `reviews_ibfk_2` FOREIGN KEY (`ISBN`) REFERENCES `book` (`ISBN`)
) ENGINE=InnoDB AUTO_INCREMENT=2001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: staff
#

DROP TABLE IF EXISTS `staff`;

CREATE TABLE `staff` (
  `staffID` INT(11) NOT NULL AUTO_INCREMENT,
  `sEmail` VARCHAR(255) NOT NULL UNIQUE,
  `sPassword` VARCHAR(255) NOT NULL,
  `jobType` VARCHAR(255) DEFAULT NULL,
  PRIMARY KEY (`staffID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: staffContact
#

DROP TABLE IF EXISTS `staffContact`;

CREATE TABLE `staffContact` (
  `sEmail` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`sEmail`),
  UNIQUE KEY `sEmail` (`sEmail`),
  CONSTRAINT `staffContact_ibfk_1` FOREIGN KEY (`sEmail`) REFERENCES `staff` (`sEmail`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



